import React from 'react'
import classes from '../../Styles/orderBox.module.css'



function OrderBoxNav(){
    return(
        <div>
            <a id={classes.navBtn} href="#">Enjoy your shopping</a>

            <div >
            <img className={classes.orderIcon} src="https://www.flaticon.com/svg/static/icons/svg/833/833400.svg" alt="icon"/>

            </div>

        </div>
    )
}

export default OrderBoxNav
